import './css/App.css';

import Home from './pages/home.js';
import Result from './component/test.js';
import react, { Component } from 'react';

import { BrowserRouter, Route, Link } from 'react-router-dom';

class App extends Component {
test1 = () => {
    <div>Test 1</div>
}

test2 = () => {
    <div>Test 2</div>
}
  render() { 
    return (
      <BrowserRouter>
          <div><Link to="/">Test 3</Link></div>   
          <div><Link to="/yolo">Test 4</Link></div>   

          <Route path="/" component={this.test1} />
          <Route path="/yolo" component={this.test2} />
      </BrowserRouter>
    );
  }
}

export default App;
